int intersectSol(unsigned short int sol[5][128][128])
{
  int i, j, k;
  int pass = 0;
  for (i = 0; i < 128; i++) {
    for (j = 0; j < 128; j++) {
      for (k = 0, sol[4][i][j] = 1; k < 4; k++) {
        sol[4][i][j] &= sol[k][i][j];
      }
      if (sol[4][i][j] == 1) {
        pass = 1;
      }
    }
  }
  return pass;
}

