void intersect(unsigned short int v[128], unsigned short int t[128],
               unsigned short int vt[128], unsigned short int inter[128][128],
               int rank)
{
  unsigned short int i, j, hold;
  for (i = 0; i < rank; i++)
  {
    for (j = 0; j < rank; j++)
    {
      hold = i^j;
      inter[i][j] = vt[hold] * t[i] * v[j];
    }
  }
}

void parity(unsigned short int us[128], unsigned short int op[128],
            unsigned short int to[128], int rank)
{
  unsigned short int i, j, hat;
  for (i = 0; i < rank; i++) {
    for (j = 0; j < rank; j++) {
      hat = us[i] && op[j];
      if (hat) {
        to[i ^ j] = 1;
      }
    }
  }
}

void prune_operation(unsigned int spread, unsigned int rank,
                    unsigned short int US[128], unsigned short int VS[128],
                    unsigned short int UT[128], unsigned short int VT[128],
                    unsigned short int sol[128][128])
{
    //static int bits[8] = {1, 2, 4, 8, 16, 32, 64, 128};
  unsigned short int v[128] = {0}, t[128] = {0}, vt[128] = {0};
  unsigned short int sol_inter[128][128];
    //get parity arrays
  parity(US, VS, v, rank);
  parity(US, UT, t, rank);
  parity(US, VT, vt, rank);
    //intersect parity arrays
  intersect(v, t, vt, sol_inter, rank);
    //expand parity arrays
  fill(sol, spread, rank, sol_inter);
}


int final_prune(struct node **head, int u[7], int v[7], int s[7], int t[7],
                solution *US, solution *VS, solution *UT, solution *VT)
{
  unsigned int i, j, k;
  int rank;
  unsigned short int sol[5][128][128] = {0};
  for (i = 0; i < 4; i++) {
    for (j = 0, k = 0; j < 128; j++) {
      if (VT->spread[i][j]) {
        rank = getRank(j);
        prune_operation(j, rank, US->parity[i][j], VS->parity[i][j],
                        UT->parity[i][j], VT->parity[i][j], sol[i]);
      }
    }
  }
  if (intersectSol(sol)) {
    printf("*");
    push(u, v, s, t, sol[4], head);
  }
  
  return 0;
}